        /// <summary>Returns the U32x3 element at a specified index.</summary>
        unsafe public ref U32x3 this[int index]
        {
            get
            {
#if ENABLE_UNITY_COLLECTIONS_CHECKS
                if ((uint)index >= 2)
                    throw new System.ArgumentException("index must be between[0...1]");
#endif
                fixed (U32x3x2* array = &this) { return ref ((U32x3*)array)[index]; }
            }
        }

